import { makeStyles } from '@mui/styles';

export default makeStyles({
  productSection: {
    backdropFilter: 'blur(30px)',
    padding: '30px',
    borderRadius: '20px'
  },
  imageHolder: {
    maxWidth: '100%'
  },
  image: {
    width: '400px',
    height: '400px',
    borderRadius: '15% 85% 28% 72% / 85% 43% 57% 15% '
  }
});
